INSERT INTO `v1_120870c6726d21b25c081fbf26ead8e85fcd559739d6cab4f56e064e24ef8e8b` VALUES (0, 1, 11, 0, 31114071, 1, 103111, 10, "本日は、私の誕生日を祝っていただいて\nありがとうございます……\n豪華なケーキまで用意していただいて、\n何かお返しを考えないといけませんね。", 31114, 0.5);
